// </template>

<script>
import EventService from '../services/EventService';
export default {
props:['id'],
data() {
  return {
    event: {}
  }
},
created() {
  EventService.getEvent(this.id).then(response =>{
    this.event = response.data;
  })
     .catch(error => {
      console.log("There was an error:",error.response);
    })
},
}

</script>
    <style scoped>
    .location {
      margin-bottom: 0;
    }
    .location > .icon {
      margin-left: 10px;
    }
    .event-header > .title {
      margin: 0;
    }
    .list-group {
      margin: 0;
      padding: 0;
      list-style: none;
    }
    .list-group > .list-item {
      padding: 1em 0;
      border-bottom: solid 1px #e5e5e5;
    }
    </style>
